import React from "react";
import { reduxForm, Field } from "redux-form";

class Signup extends React.Component {
  render() {
    return (
      <form>
        <fieldset>
          <label>Email</label>
        </fieldset>
        <fieldset>
          <label>password</label>
        </fieldset>
      </form>
    );
  }
}
export default Signup;
